import {
    Button,
    Radio
} from "antd";
import './App.css';

import {getAllStudents} from "./client";

function App() {
    getAllStudents()
        .then(res => res.json())
        .then(console.log)
    return (
        <div className="App">
            <Button type='primary'>Hello</Button>
            <Radio.Group>
                <Radio value={1}>A</Radio>
                <Radio value={2}>B</Radio>
                <Radio value={3}>C</Radio>
                <Radio value={4}>D</Radio>
            </Radio.Group>
        </div>
    );
}

export default App;
